import './App.css';
import Header from './layout/header';
import Footer from './layout/footer';
import Registration from './pages/registration';

const title = {
  name:'register'
}
function change(){
  console.log(title);
}
function App() {
  const headers = [
    {id:1,link:'home',title:'Главная'},
    {id:2,link:'home',title:'Контакты'},
    {id:3,link:'home',title:'О нас'},
  ]

  return (
    <>
    {/* <Header headers={headers}/> */}
    <Header />
    <h2 onClick={change()}>{title.name}</h2>
    <div className="content">
      <Registration/>

    </div>
    <Footer/>
    </>
  );
}

export default App;
